tinymce.PluginManager.add("insertfbframe",function(n,i){function t(n){return'<div class="insert-frame"><iframe class="insert-frame-item" src="'+n+'" allowfullscreen></iframe></div>'}n.addButton("frame",{title:"Вставить фрейм",text:"IF",icon:!1,onclick:function(){n.windowManager.open({title:"Вставить ссылку",body:[{type:"textbox",name:"link",label:"Ссылка"}],onsubmit:function(i){i.data.link&&n.insertContent(t(i.data.link))}})}})});